    public int minDominoRotations(int[] A, int[] B) {
        int lenght = A.length; //4320 - 3264  // 4320-3236
        int swapForA = 0;
        int swapForA1 = 0;
        int swapForB = 0;
        int swapForB1 = 0;

        for (int i = 0; i < lenght ; i++) {
            if (A[0] != A[i]){
                if (A[0] != B[i]) {
                    swapForA = Integer.MAX_VALUE;
                    swapForA1 = Integer.MAX_VALUE;
                    break;
                }
                swapForA++;
            }
            if (A[0] != B[i]) {
                swapForA1++;
            }
        }
        swapForA = Math.min(swapForA, swapForA1);

        for (int i = 0; i < lenght ; i++) {
            if (B[0] != B[i]){
                if (B[0] != A[i]) {
                    swapForB = Integer.MAX_VALUE;
                    swapForB1 = Integer.MAX_VALUE;
                    break;
                }
                swapForB++;
            }
            if (B[0] != A[i]) {
                swapForB1++;
            }
        }
        swapForB = Math.min(swapForB, swapForB1);

        return Math.min(swapForA, swapForB) == Integer.MAX_VALUE ? -1 : Math.min(swapForA, swapForB);
    }

